import styled from 'styled-components';

const StyledButton = styled.button`
  background-color: #0074d9;
  color: #ffffff;
  outline: none;
  cursor: pointer;
  padding: 1em;
  font-family: var(--global-font);
  width: 100%;
  font-size: 1.3em;
`;

export default StyledButton;
